  yOffset: 0,
  xOffset: 0,
  transform: ''
};
export const CameraIcon = props => {
  const newProps = Object.assign({
    config: CameraIconConfig
  }, props);
  return React.createElement(SVGIcon, newProps);
};
export default CameraIcon;
